  selectLang(lang) {
    this.translateService.use(lang);
  }
  setLang(lang) {
    this.lang = lang;
    switch (lang) {
      case 'en':
        this.intl.strings = englishStrings;
        break;
      case 'en-short':
        this.intl.strings = englishShortStrings;
        break;
      case 'fr':
        this.intl.strings = frenchStrings;
        break;
      case 'fr-short':
        this.intl.strings = frenchShortStrings;
        break;
      default:
        break;
    }
    this.intl.changes.next();
  }
  time() {
    let date = new Date();
    let second = date.getSeconds();
    let minute = date.getMinutes();
    let hour = date.getHours();
    if (second < 10) {
      second = '0' + second;
    }
    if (minute < 10) {
      minute = '0' + minute;
    }
    if (hour < 10) {
      hour = '0' + hour;
    }
    this.seconde = second;
    this.heure = hour;
    this.minute = minute;
    this.clock = hour + ":" + minute + ":" + second;
  }
